
window.trueid = 1;
window.truepst = "";
window.truelat = "";
window.truelng = "";

window.round =0;
window.score =0;

function getRndInteger(min, max) {
	window.trueid = Math.floor(Math.random() * (max - min)) + min;
	window.truelat = myArray.find(x => x.id === window.trueid).lat;
	window.truelng = myArray.find(x => x.id === window.trueid).long;
	window.truepst = myArray.find(x => x.id === window.trueid).postcode;
  return window.truepst;
}

document.getElementById('date').innerHTML = new Date().toDateString();

function initMap() {
  var myLatlng = {lat: 52.30, lng: -1.88};

  var map = new google.maps.Map(
      document.getElementById('map'), {zoom: 6, center: myLatlng});

  // Create the initial InfoWindow.
  var infoWindow = new google.maps.InfoWindow(
      {content: 'Click the map to set the position!', position: myLatlng});
  infoWindow.open(map);

  // Configure the click listener.
  map.addListener('click', function(mapsMouseEvent) {
    // Close the current InfoWindow.
    infoWindow.close();

    // Create a new InfoWindow.
    infoWindow = new google.maps.InfoWindow({position: mapsMouseEvent.latLng});
    infoWindow.setContent(mapsMouseEvent.latLng.toString());
    document.getElementById('guessLat').innerHTML = "" + mapsMouseEvent.latLng.lat().toFixed(2);
    document.getElementById('guessLong').innerHTML = "" + mapsMouseEvent.latLng.lng().toFixed(2);
    infoWindow.open(map);
  });
}


function checkit(lat1, lon1, lat2, lon2) {
	if ((lat1 == lat2) && (lon1 == lon2)) {
		return 0;
	}
	else {
		var radlat1 = Math.PI * lat1/180;
		var radlat2 = Math.PI * lat2/180;
		var theta = lon1-lon2;
		var radtheta = Math.PI * theta/180;
		var dist = Math.sin(radlat1) * Math.sin(radlat2) + Math.cos(radlat1) * Math.cos(radlat2) * Math.cos(radtheta);
		if (dist > 1) {
			dist = 1;
		}
		dist = Math.acos(dist);
		dist = dist * 180/Math.PI;
		dist = dist * 60 * 1.1515;
		dist = dist * 1.609344
		if (window.round < 5){
			window.round = window.round +1;
			window.score = window.score + dist;
		}
		else {
		 	window.round = 1;
			window.score = dist;

		}
		document.getElementById('sollat').innerHTML = window.truelat.toFixed(2);
    document.getElementById('sollng').innerHTML = window.truelng.toFixed(2);

		document.getElementById('roundcount').innerHTML = window.round;
    document.getElementById('sumdist').innerHTML = window.score.toFixed(2);

		return dist.toFixed(2);
	}
}





